import logo from './images/logo.svg';
import menu from './images/icons8-menu.svg';
import { useState } from 'react';
import Links from './Links';

const Navbar = () => {
    const [showLink, setShowLink] = useState(false);
    return (
        <nav className='w-10/12 mx-auto py-10 flex justify-between'>
            <img 
            className='h-8'
            src={logo} 
            alt="logo"/>
            {showLink && <Links />}
            di
            <div className=''>
                <p className='py-4'>Features</p>
                <p className='py-2'>Pricing</p>
                <p className='py-4'>Resources</p>
            </div>
            <div className='pb-8'>
                <p className='pt-8 pb-4'>Login</p>
                <button className='py-2 bg-cYan w-4/5 rounded-3xl'>Sign Up</button>
            </div>
            <img 
            className='h-8 md:hidden'
            src={menu} 
            onClick={() => setShowLink(!showLink)}
            alt="navbar"/>
        </nav>
    );
}

export default Navbar;
